import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import Products from './Products';

function App() {
  return (
    <BrowserRouter>
      <nav style={{ padding: 20 }}>
        <Link to="/">Home</Link> | 
        <Link to="/products?category=electronics&sort=price">Electronics</Link> | 
        <Link to="/products?category=clothing&sort=name">Clothing</Link>
      </nav>

      <Routes>
        <Route path="/" element={<h1>Welcome to the App!</h1>} />
        <Route path="/products" element={<Products />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
